ReactDom.render(
  <>
    <h1 style={{ textAlign: "center", margin: "20px 0 20px 0", letterSpacing: "0.5px" }}>List of Netflix Series</h1>
    {Sdata.map((val, i, Sdaa) => {
      return (
        <Card imgsrc={val.imgsrc}
          title={val.title}
          fname={val.fname}
          olink={val.olink}
        />)
    })}


  </>, document.getElementById('root')
)
